import React from 'react'

const Navbar = () => {
    return(
    <div className="navbar">
        <ul>
            <li className="link"><a href="#">MY WORKS</a></li>
            <li className="link"><a href="#">CONTACT ME</a></li>
        </ul>
    </div>
)
}

export default Navbar;
